function login(agent, credentials) {
    log.debug({ creds: credentials }, 'Logging in with credentials');
    return agent.post('/api/auth/signin')
        .send(credentials)
        .expect(200)
        .then(function (signinRes, alt) {
            log.debug({ signinRes: signinRes, alt: alt, cookie: signinRes.headers['set-cookie'] }, 'Client Login Successful');

            return signinRes;
        })
        .catch(function (signinErr) {
            log.error({ error: signinErr }, 'Error logging into app');
            return Q.reject(signinErr);
        });
}

function token(agent, credentials, client) {
    var endpoint = '/oauth/token';

    var payload = _.extend(credentials, {
        grant_type: 'password',
        client_id: client.clientId,
        client_secret: client.clientSecret
    });

    return agent.post(endpoint)
        .send(payload)
        .expect(200);
}

function cleanTables(tables) {
    var promises = _.map(tables, function (table) {
        if (_.isString(table)) {
            table = mongoose.model(table);

            return !!table ? table.remove().exec() : true;
        }
        return table.remove().exec();
    });

    return Q.all(_.map(promises));
}

function populateAdminUser() {
    var admin = new User({
        firstName: 'Adam',
        lastName: 'admin',
        email: 'admin@test.com',
        username: 'admin',
        password: 'password',
        provider: 'local',
        roles: ['user', 'admin'],
        type: ''
    });

    return admin.save();
}

function getAdminCredentials() {
    return { username: 'admin', password: 'password' };
}

function populateStubUsers(count) {
    return Q.all(_.map(_.slice(SeedUsers, 0, count), function (item) {
        var user = item.user;
        user.type = 'driver';
        user.provider = 'local';
        user.password = user.password.length >= 8 ? user.password : user.password + user.password;
        delete user.salt;
        user.firstName = user.name.first;
        user.lastName = user.name.last;
        user.profileImageURL = user.picture.medium;

        var u = new User(user);
        return u.save();
    }));
}

